import React, { Component } from 'react';
import { connect } from 'react-redux';
import {doIncrement} from '../store/show';

class Search extends Component {


    render() {
        const {doIncrement} = this.props;
        //const {val} = this.props;
       // console.log(val);
        return(
            <div className="app-header">
                <span><h1 className="logo">Trip Planner</h1></span>
                <span><div className="searchbar">
                    <form >
                        <input type="text" name="searchbar" placeholder="Search for a place"></input>
                        <button onClick={(e) => { e.preventDefault(); doIncrement()}} type="submit">S</button>
                    </form>
                </div></span>
            </div>
        );
    }
}

const mapStateToProps = state => {
    return {
        val : state.increment.count
    };
}

const mapDispatchToProps = dispatch => {
    return {
        doIncrement : () => {
            dispatch(doIncrement());
        }
    };
}


export default connect(mapStateToProps, mapDispatchToProps)(Search);
